import React, {Component} from 'react';
import {Navbar, Nav} from 'react-bootstrap';

class Header extends Component{
  render(){
    return(
      <Navbar bg="dark" className="justify-content-between" variant="dark">
        <Navbar.Brand>anshor.space</Navbar.Brand>
        <Nav className="float-right">
          <Nav.Link className="float-right" href="#">ABOUT</Nav.Link>
          <Nav.Link className="float-right" href="#">SKILL</Nav.Link>
          <Nav.Link className="float-right" href="#">PROJECT</Nav.Link>
          <Nav.Link className="float-right" href="#">CONTACT</Nav.Link>
        </Nav>
      </Navbar>
    );
  }
}

export default Header;
